window.bookSummaryJSON = "<p>The thrilling conclusion to the <i>New York Times</i> best-selling series the <i>Chicago Tribune</i> called \"Sherlock Holmes crossed with <i>Buffy the Vampire Slayer</i>\" sends the eccentric detective and his indispensable assistant into the heart of a war between magical worlds. </p> <p>The fate of the world is in the hands of detective of the supernatural R. F. Jackaby and his intrepid assistant, Abigail Rook. An evil king is turning ancient tensions into modern strife, using a blend of magic and technology to push Earth and the Otherworld into a mortal competition. Jackaby and Abigail are caught in the middle as they continue to solve the daily mysteries of New Fiddleham, New England - like who's created the rend between the worlds, how to close it, and why zombies are appearing around town. At the same time, the romance between Abigail and the shape-shifting police detective Charlie Cane deepens, and Jackaby's resistance to his feelings for 926 Augur Lane's ghostly lady, Jenny, begins to give way. Before the four can think about their own futures, they will have to defeat an evil that wants to destroy the future altogether. </p> <p>The epic conclusion to the <i>New York Times</i> best-selling Jackaby series features sly humor and a quirky cast of unforgettable characters as they face off against their most dangerous, bone-chilling foe ever. </p>"; 
